(*
aN[x1,x2,...,xN] gives the x-coordinates and associated B-matrices for the cluster algebra of type A_n, x1\[Rule]x2\[Rule]...\[Rule]xN
dN[x1,x2,...,xN-1,xN] gives the cluster algebra of type D_n, where x_{N-1} and x_{N-2} are the "prongs" at the end of x1\[Rule]x2\[Rule]...x_{N-3}
e6[x1,x2,...,x6] gives the cluster algebra for E_6

calling aN[], dN[], e6[] with no arguments produces the generic fN[x1,x2,...,xN]

this takes a little while to load, and the algebra commands are time-consuming; would be nice to fix
*)

